description:
The original Sims! This is the full collection with all expansions. You can't pick which expansions you want, it will install them all.

This game is perfect if you have an older computer running Windows XP - Windows 7 and can't play Sims 2-3. The installation is very easy and the instructions are there if you need them.

The expansions are:

&quot;Living Large&quot;
&quot;House Party&quot;
&quot;Hot Date&quot;
&quot;Vacation&quot;
&quot;Unleashed&quot;
&quot;Superstar&quot;
&quot;Makin' Magic&quot;

Have fun!
